import React from 'react'

const ListProduct = ({products}) => {

  const List = () => {
    console.log(111)
    let content = []
    for (let product of products) {
      content.push(<li>{product.name}</li>);
    }
    return content;
  };

  return (
    <div>
      {List(products)}
    </div>
  );
}

export default ListProduct;
